  "text" : "まぁ確かに、確実かつ簡便な避妊法が浸透したヒト社会がどうなるのかについては、非常に興味深いところがある。やはり最高位のコミュニケーションとして性交渉が位置づけられるのだろうか。それとも現在のご飯を食べに行くみたいな感じになるのだろうか。",
