  "geo" : {
  },
  "id_str" : "257491237966315520",
  "text" : "でも例えば、生殖器官の機能を自由に調整できるようにする、つまり精子や卵子の生成を止めたり再開したりが自由意志によって行えるようになれば、少なくとも「望まれない子」という悲劇は回避され、かつ最上の愛情表現としての性交も保たれるのではないだろうか。",
  "id" : 257491237966315520,
  "created_at" : "Sun Oct 14 14:41:09 +0000 2012",
