  "text" : "高校（後期中等教育）以降って基本的にレベルが同じというかある程度そろってる集団で固まるから、その世界が当たり前で一般的で多数派だと思ってしまうんですよね。それが違うのだと思い知らせてくれるのが小中の時の同級生たち。よくできたシステムだ。",
