  "geo" : {
  },
  "id_str" : "253809436265689089",
  "text" : "「さよならと言った君の気持ちは分からないけど」（槇原敬之『もう恋なんてしない』）に対して、前の歌詞をもって「ご飯作ってもらって文句言ってるからだ」ってツッコミが流行ってるけど、それ、「振られたけど女々しく泣かず（文句言えるぐらいに）剛気な男になりたい」って意味ですからね？",
  "id" : 253809436265689089,
